import React from 'react';


function Prstest(props){
    return (
        <div className='container mt-5'>
            <div class="row row-cols-3 row-cols-md-3 g-4 ">
                <div class="col">
                    <div class="card">
                    <img src="https://picsum.photos/26" class="card-img-top" alt="..."/>
                   
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Prstest;
